import './App.css';
import WeatherTile from './WeatherTile'

let w1
function App() {
  fetch('http://api.weatherapi.com/v1/forecast.json?key=6018bc6ca5bb4a4884c184418202812&q=Winnipeg&days=5')
  .then(response => response.json())
  .then(json => {
    const weatherData = Array(json.forecast.forecastday[0])
    console.log(weatherData)
    w1 = weatherData.map(data => {
      return <WeatherTile main={data.maxtemp_c}  />
    })
    //console.log(w1)
    })
  return (
    <div className="App">
    <h1>Hi</h1>
    {w1}
    </div>
  );
}

export default App;
